    ##############################################
    # medlemsfunktioner
    
    def getCityName(self, idx):
        return self.cities[idx][0]
        
    def getCityIdx(self, cityname):
    	for city in self.cities:
    		if city[0] == cityname:
    			return self.cities.index(city)

    def getCityCoord(self, idx):
        return self.cities[idx][1]

    def getNumberOfCities(self):
        return self.numberOfCities

    def getNeighborsTo(self, city):
        return self.neighbors[city]

    def hasEdge(self, city1, city2):
        return (city1, city2) in self.edges

    def getCostBetween(self, city1, city2):
        return self.edges[(city1,city2)]

